import styled from "styled-components";

const CardListStyled = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: center;
  flex-wrap: wrap;
  background-color: red;
  margin-right: auto;
  margin-right: auto;
`;

export default CardListStyled;
